import React from "react";
import {Container} from "./PokemonCard";
export const PokemonList = () => {
    const [data,setData] = React.useState([]);
    fetch("https://pokeapi.co/api/v2/pokemon/?offset=20&limit=20")
    .then(res=>res.json())
    .then(data=>setData(data));
    return(
        <>
        <h1>Pokemon List</h1>

        </>
    );
}
